import React, { useEffect, useState } from 'react';
import axios from 'axios';

const InventorySummaryPage = () => {
  const [items, setItems] = useState([]);
  const [selectedRack, setSelectedRack] = useState('All');

  useEffect(() => {
    fetchInventory();
  }, []);

  const fetchInventory = async () => {
    try {
      const res = await axios.get('http://localhost:5050/api/inventory/all');
      setItems(res.data);
    } catch (err) {
      console.error('Error fetching inventory:', err);
    }
  };

  const groupByRack = () => {
    const grouped = {};
    items.forEach((item) => {
      const rackLetter = item.location?.[0]?.toUpperCase() || 'Unknown';
      if (!grouped[rackLetter]) {
        grouped[rackLetter] = [];
      }
      grouped[rackLetter].push(item);
    });
    return grouped;
  };

  const groupedItems = groupByRack();
  const racks = Object.keys(groupedItems).sort();

  const filteredRacks = selectedRack === 'All' ? racks : [selectedRack];

  return (
    <div style={styles.container}>
      <h2>ðŸ“¦ Inventory Summary by Rack</h2>

      <div style={styles.topBar}>
        <label style={styles.filterLabel}>Filter by Rack: </label>
        <select 
          style={styles.select} 
          value={selectedRack} 
          onChange={(e) => setSelectedRack(e.target.value)}
        >
          <option value="All">All</option>
          {racks.map((rack) => (
            <option key={rack} value={rack}>Rack {rack}</option>
          ))}
        </select>
        <span style={styles.totalCount}>Total Items: {items.length}</span>
      </div>

      {filteredRacks.map((rack) => (
        <div key={rack} style={styles.rackSection}>
          <h3 style={styles.rackTitle}>Rack {rack} ({groupedItems[rack].length} items)</h3>
          <table style={styles.table}>
            <thead>
              <tr>
                <th style={styles.th}>Item</th>
                <th style={styles.th}>Description</th>
                <th style={styles.th}>Location</th>
                <th style={styles.th}>Quantity</th>
              </tr>
            </thead>
            <tbody>
              {groupedItems[rack].map((item) => (
                <tr key={item._id} style={styles.rowBorder}>
                  <td>{item.name}</td>
                  <td>{item.description || 'â€”'}</td>
                  <td>{item.location}</td>
                  <td>{item.quantity}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ))}
    </div>
  );
};

const styles = {
  container: {
    padding: '30px',
    fontFamily: 'Arial, sans-serif',
    background: 'linear-gradient(to right, #e0f7fa, #fdfdfd)',
    minHeight: '100vh'
  },
  topBar: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: '20px'
  },
  filterLabel: {
    fontWeight: 'bold',
    marginRight: '10px'
  },
  select: {
    padding: '6px 10px',
    fontSize: '16px',
    borderRadius: '5px',
    border: '1px solid #ccc'
  },
  totalCount: {
    fontWeight: 'bold',
    fontSize: '16px',
    color: '#555'
  },
  rackSection: {
    marginBottom: '40px',
    backgroundColor: '#fff',
    padding: '15px',
    borderRadius: '10px',
    boxShadow: '0 0 8px rgba(0,0,0,0.08)'
  },
  rackTitle: {
    marginBottom: '10px',
    color: '#333',
    textAlign: 'left'
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse'
  },
  th: {
    textAlign: 'left',
    padding: '8px 6px',
    borderBottom: '2px solid #ccc'
  },
  rowBorder: {
    borderBottom: '1px solid #eee'
  }
};

export default InventorySummaryPage;
